const AdminLogin = () => {
  return (
    <section>
      <div>
        <form>
          <label htmlFor="">Username</label>
          <input type="text" />
          <label htmlFor="">Password</label>
          <input type="password" />
          <button>Login</button>
        </form>
      </div>
    </section>
  );
};

export default AdminLogin;
